import './Logement.css';
import React, { useState, useEffect } from 'react';

function Logement({ props }) {


  return (
    <div>
      {props.map((logement, index) => (
        <div className="logement-wrapper" key={index}>
          <p>logement.adresse</p>
          <p>logement.type</p>
          <p>logement.surface</p>
          <p>logement.prix</p>
        </div>
      ))}
    </div>
  );

}

export default Logement;
